caption.text:
-
hey, you, let me show you something good;
yeah, it can be something good;
if you let me show you everything—
i can be your everything;
-
will you be my everything?

-
i am running through empty streets to find you;
where are you hiding now?

.
Paint-chipped skies;
Nothing is ever as it seems;
–
Behind these codeine eyes;
Blind to the world in between;
.
.
—2015, Karimun Jawa

.
I'm not afraid anymore;
What makes you sure you're all I need?
-
Forget about it;
-
When you walk out the door and leave me torn;
You're teaching me to live without it.

∘
actually i'm grateful for all i have;
all i've ever received;
all i've ever achieved;
all of these talents and flaws;
but what ever come out are just words of discontents and insecurities;

☽
And we skydive from walls we built;
Dying just to feel alive.
